//import * as axs from './Midwares/axs';

import axios from 'axios';

const diariesUrl = 'http://localhost:5000/diaries';

const getDiariesApi = () => axios.get(diariesUrl);

export const getDiariesAction = () => async (dispatch) => {
    try{
        const {data} = await getDiariesApi();

        dispatch ({type: 'GET_ALL_DIARIES', payload: data});
    } catch(error) {
        console.log(error.message);
    }
}
